import React from 'react';
import './App.css';
import AppBar from '@material-ui/core/AppBar';
import {Toolbar} from "@material-ui/core";

function TopBar() {
    return (
        <div>
            <div>
                Ben Dunk
            </div>
            <AppBar position="static">
                <Toolbar>
                    <div>
                        Home
                    </div>
                    <div>
                        Projects
                    </div>
                </Toolbar>
            </AppBar>
        </div>
    );
}

export default TopBar;
